import React from "react";
import { Link } from "react-router-dom";
import {
  Container,
  Row,
  Col,
  Card,
  CardBody,
  FormInput,
  FormGroup,
  FormSelect,
  Form,
  Button,
} from "shards-react";

import "../styles/register.css";

export default class Register extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      remember: false
    }

    this.createAccount.bind(this);
  };

  createAccount(e) {
    e.preventDefault()
    e.persist();
    console.log(e.target.email.value);
    console.log(e.target.password.value);
    console.log("remember me: ", this.state.remember)
  }

  render() {
    return (
      <Container fluid className="main-content-container px-4 h-100">
        <Row noGutters className="h-100">
          <Col className="mx-auto register">
            <Card small>
              <CardBody className="px-4">
                <h5 className="register__titulo text-center mt-5 mb-4">Crea una cuenta nueva</h5>
                <Form>
                  <Row form>
                    {/* Nombre */}
                    <Col md="6" className="form-group">
                      <label htmlFor="name">Nombre</label>
                      <FormInput
                        id="name"
                        placeholder="Nombre"
                        // onChange={() => { }}
                      />
                    </Col>
                    {/* Apellido */}
                    <Col md="6" className="form-group">
                      <label htmlFor="lastname">Apellido</label>
                      <FormInput
                        id="lastname"
                        placeholder="Apellido"
                        // onChange={() => { }}
                      />
                    </Col>
                  </Row>
                  <Row form>
                    {/* Email */}
                    <Col className="form-group">
                      <label htmlFor="email">Email</label>
                      <FormInput
                        type="email"
                        id="email"
                        placeholder="Dirección de correo"
                        // onChange={() => { }}
                        autoComplete="email"
                      />
                    </Col>
                  </Row>
                  <Row form>
                    {/* Contraseña */}
                    <Col md="6" className="form-group">
                      <label htmlFor="password">Contraseña</label>
                      <FormInput
                        type="password"
                        id="password"
                        placeholder="Contraseña"
                        // onChange={() => { }}
                        autoComplete="current-password"
                      />
                    </Col>
                    {/* Repetir contraseña */}
                    <Col md="6" className="form-group">
                      <label htmlFor="repeat-password">Repetir contraseña</label>
                      <FormInput
                        type="password"
                        id="repeat-password"
                        placeholder="Repetir contraseña"
                        // onChange={() => { }}
                        // autoComplete="current-password"
                      />
                    </Col>
                  </Row>
                  <FormGroup>
                    <label htmlFor="address">Dirección</label>
                    <FormInput
                      id="address"
                      placeholder="Dirección"
                      // onChange={() => { }}
                    />
                  </FormGroup>
                  <Row form>
                    {/* Dirección */}
                    <Col md="9" className="form-group">
                      <label htmlFor="address">Dirección</label>
                      <FormInput
                        id="city"
                        placeholder="Ciudad"
                        // onChange={() => { }}
                      />
                    </Col>
                    {/* Zip Code */}
                    <Col md="3" className="form-group">
                      <label htmlFor="zipcode">CP</label>
                      <FormInput
                        id="zipcode"
                        placeholder="CP"
                        // onChange={() => { }}
                      />
                    </Col>
                  </Row>
                  <Button type="submit" theme="accent">Registrarse</Button>
                </Form>
              </CardBody>
            </Card>
            <div className="px-2 pt-3 register__justify_links">
              <Link to="/forgot-password">Olvidaste tu contraseña?</Link>
              <Link to="/#">Crea una cuenta nueva</Link>
            </div>
          </Col>
        </Row>
      </Container>
    );
  }
}
